function Buns() {

  const {data} = useOutletContext()


    const poop = useOutletContext(data).map((item)=>(
        <h4 key={item.id}>{item.name}</h4>
    ))

  return (
    <div>
      <Navbar />
      <h2>Buns</h2>
{poop}
    </div>
  );
}

export default Buns;
